import React from "react";
import { Link } from "react-router-dom";

function Navbar({ setCategory, cartCount }) {
  return (
    <nav className="navbar navbar-dark bg-dark px-4">
      <Link className="navbar-brand" to="/">üéÅ Gift Shop</Link>

      <div>
        <button className="btn btn-outline-light me-2" onClick={() => setCategory("all")}>All</button>
        <button className="btn btn-outline-light me-2" onClick={() => setCategory("birthday")}>Birthday</button>
        <button className="btn btn-outline-light me-2" onClick={() => setCategory("valentine")}>Valentine</button>
        <button className="btn btn-outline-light me-3" onClick={() => setCategory("christmas")}>Christmas</button>

        <Link to="/cart" className="btn btn-warning">
          Cart ({cartCount})
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
